export default {
    name: 'c_input_list',
    props: {
        name: {
            type: String
        },
        configData:{
            type:null
        }
    },
    data () {
        return {
            defaults: {},
            datas: this.configData
        }
    },
    mounted () {},
    watch: {
        configData: {
            handler (nVal, oVal) {
                this.datas = nVal
            },
            immediate: true,
            deep: true
        }
    },
    methods: {}
}
